INSERT INTO object( uuid, id, title, body, views, likes, author-id, created-at, updated-at ) VALUES ( 'ojF2cCpI', '1', '<p>Patre eorum, reficientes retia.</p>', '<p>Qui cum audissent regem, abierunt, et ecce stella, quam viderant in oriente, antecedebat eos, usque dum veniens staret supra, ubi erat puer. Videntes autem stellam gavisi sunt gaudio magno valde.</p><p>Et intrantes domum, invenerunt puerum cum Maria matre ejus, et procidentes adoraverunt eum et apertis thesauris suis obtulerunt ei munera, aurum, thus, et myrrham.</p>', '500', '540', '1', '2021-06-24T15:45:46.690Z', '2021-06-24T15:45:46.690Z' );
INSERT INTO object( uuid, id, title, body, views, likes, author-id, created-at, updated-at ) VALUES ( 'Ecvpp1nx', '2', '<p>Mercedem suam. Te autem.</p>', '<p>Non omnis who dicit mihi, Domine, Domine, intrabit in regnum Caelorum sed that facit voluntatem Patris mei, who is in Cælis, ipse intrabit in regnum Caelorum. Multi dicent illa die in mihi Domine, Domine, in nomine tuo prophetavimus nun, and in nomine tuo Daemonia ejecimus and in nomine tuo virtutes multas fecimus? And tunc Confitebor illis numquam novi your Quia discedite was me who operamini iniquitatem.</p><p>Omnis ergo that audit verba mea CEST and facit Others assimilabitur viro Sapienti which ædificavit domum suam petram supra, and down pluvia and venerunt flumina and flaverunt fan and irruerunt in domum illam, not cecidit Fundata enim erat super petram. And that omnis verba mea CEST audit and non facit Others similis erit viro stulto which ædificavit domum suam super arenam and down pluvia and venerunt flumina and flaverunt fan and irruerunt in domum illam and cecidit and leaking ruined illius magna.</p>', '956', '608', '1', '2021-06-24T15:45:46.756Z', '2021-06-24T15:45:46.756Z' );
INSERT INTO object( uuid, id, title, body, views, likes, author-id, created-at, updated-at ) VALUES ( 'OQaSuEvY', '3', '<p>In tenebris, vidit lucem.</p>', '<p>Qui consurgens, accepit puerum, et matrem ejus, et venit in terram Israël. Audiens autem quod Archelaus regnaret in Judæa pro Herode patre suo, timuit illo ire et admonitus in somnis, secessit in partes Galilææ.</p><p>Et veniens habitavit in civitate quæ vocatur Nazareth ut adimpleretur quod dictum est per prophetas Quoniam Nazaræus vocabitur. In diebus autem illis venit Joannes Baptista prædicans in deserto Judææ, et dicens Pœnitentiam agite appropinquavit enim regnum cælorum.</p>', '407', '828', '1', '2021-06-24T15:45:46.772Z', '2021-06-24T15:45:46.772Z' );
INSERT INTO object( uuid, id, title, body, views, likes, author-id, created-at, updated-at ) VALUES ( 'pRadgYoX', '4', '<p>Nomen tuum. Adveniat regnum.</p>', '<p>Qui cum audissent regem, abierunt, et ecce stella, quam viderant in oriente, antecedebat eos, usque dum veniens staret supra, ubi erat puer. Videntes autem stellam gavisi sunt gaudio magno valde.</p><p>Et intrantes domum, invenerunt puerum cum Maria matre ejus, et procidentes adoraverunt eum et apertis thesauris suis obtulerunt ei munera, aurum, thus, et myrrham.</p>', '725', '813', '1', '2021-06-24T15:45:46.797Z', '2021-06-24T15:45:46.797Z' );
INSERT INTO object( uuid, id, title, body, views, likes, author-id, created-at, updated-at ) VALUES ( '8iy2QkVD', '5', '<p>Vobis thesauros in cælo.</p>', '<p>Dico enim vobis, quia nisi abundaverit justitia vestra plus quam scribarum et pharisæorum, non intrabitis in regnum cælorum. Audistis quia dictum est antiquis Non occides qui autem occiderit, reus erit judicio.</p><p>Ego autem dico vobis quia omnis qui irascitur fratri suo, reus erit judicio. Qui autem dixerit fratri suo, raca reus erit concilio. Qui autem dixerit, fatue reus erit gehennæ ignis.</p>', '761', '310', '1', '2021-06-24T15:45:46.864Z', '2021-06-24T15:45:46.864Z' );
INSERT INTO object( uuid, id, title, body, views, likes, author-id, created-at, updated-at ) VALUES ( 'dHmAw7d6', '6', '<p>Sed super candelabrum, ut.</p>', '<p>Tunc adimpletum est quod dictum est per Jeremiam prophetam dicentem dicens Surge, et accipe puerum, et matrem ejus, et vade in terram Israël defuncti sunt enim qui quærebant animam pueri.</p><p>Qui consurgens, accepit puerum, et matrem ejus, et venit in terram Israël. Audiens autem quod Archelaus regnaret in Judæa pro Herode patre suo, timuit illo ire et admonitus in somnis, secessit in partes Galilææ.</p>', '955', '430', '1', '2021-06-24T15:45:46.880Z', '2021-06-24T15:45:46.880Z' );
INSERT INTO object( uuid, id, title, body, views, likes, author-id, created-at, updated-at ) VALUES ( 'y7twxW4A', '7', '<p>Et Andream fratrem ejus.</p>', '<p>Et congregans omnes principes sacerdotum, et scribas populi, sciscitabatur ab eis ubi Christus nasceretur. At illi dixerunt In Bethlehem Judæ sic enim scriptum est per prophetam Tunc Herodes clam vocatis magis diligenter didicit ab eis tempus stellæ, quæ apparuit eis et mittens illos in Bethlehem, dixit Ite, et interrogate diligenter de puero et cum inveneritis, renuntiate mihi, ut et ego veniens adorem eum.</p><p>Qui cum audissent regem, abierunt, et ecce stella, quam viderant in oriente, antecedebat eos, usque dum veniens staret supra, ubi erat puer. Videntes autem stellam gavisi sunt gaudio magno valde.</p>', '607', '103', '1', '2021-06-24T15:45:46.920Z', '2021-06-24T15:45:46.920Z' );
INSERT INTO object( uuid, id, title, body, views, likes, author-id, created-at, updated-at ) VALUES ( 'DwKTrE0I', '8', '<p>Evangelium regni et sanans.</p>', '<p>Si autem fœnum agri, quod hodie est, et cras in clibanum mittitur, Deus sic vestit, quanto magis vos modicæ fidei? Nolite ergo solliciti esse, dicentes Quid manducabimus, aut quid bibemus, aut quo operiemur? hæc enim omnia gentes inquirunt. Scit enim Pater vester, quia his omnibus indigetis.</p><p>Quærite ergo primum regnum Dei, et justitiam ejus et hæc omnia adjicientur vobis. Nolite ergo solliciti esse in crastinum. Crastinus enim dies sollicitus erit sibi ipsi sufficit diei malitia sua.</p>', '974', '106', '1', '2021-06-24T15:45:46.940Z', '2021-06-24T15:45:46.940Z' );
INSERT INTO object( uuid, id, title, body, views, likes, author-id, created-at, updated-at ) VALUES ( 'AgZWmK1W', '9', '<p>Ex fructibus eorum cognoscetis.</p>', '<p>Et procedens inde, vidit alios duos fratres, Jacobum Zebedæi, et Joannem fratrem ejus, in navi cum Zebedæo patre eorum, reficientes retia sua et vocavit eos. Illi autem statim relictis retibus et patre, secuti sunt eum.</p><p>Et circuibat Jesus totam Galilæam, docens in synagogis eorum, et prædicans Evangelium regni et sanans omnem languorem, et omnem infirmitatem in populo.</p>', '586', '651', '1', '2021-06-24T15:45:46.964Z', '2021-06-24T15:45:46.964Z' );
INSERT INTO object( uuid, id, title, body, views, likes, author-id, created-at, updated-at ) VALUES ( '8ZlyMKEP', '10', '<p>Mutuari a te, ne.</p>', '<p>Cum autem descendisset de monte, secutæ sunt eum turbæ multæ et ecce leprosus veniens, adorabat eum, dicens Domine, si vis, potes me mundare. Et extendens Jesus manum, tetigit eum, dicens Volo mundare. Et confestim mundata est lepra ejus. Et ait illi Jesus Vide, nemini dixeris sed vade, ostende te sacerdoti, et offer munus, quod præcepit Moyses, in testimonium illis.</p><p>Cum autem introisset Capharnaum, accessit ad eum centurio, rogans eum, et dicens Domine, puer meus jacet in domo paralyticus, et male torquetur. Et ait illi Jesus Ego veniam, et curabo eum. Et respondens centurio, ait Domine, non sum dignus ut intres sub tectum meum sed tantum dic verbo, et sanabitur puer meus.</p>', '530', '365', '1', '2021-06-24T15:45:46.994Z', '2021-06-24T15:45:46.994Z' );
INSERT INTO object( uuid, id, title, body, views, likes, author-id, created-at, updated-at ) VALUES ( 'eCKhulPC', '11', '<p>Sic vestit, quanto magis.</p>', '<p>Esto consentiens adversario tuo cito dum es in via cum eo ne forte tradat te adversarius judici, et judex tradat te ministro et in carcerem mittaris.</p><p>Amen dico tibi, non exies inde, donec reddas novissimum quadrantem. Audistis quia dictum est antiquis Non mœchaberis. Ego autem dico vobis quia omnis qui viderit mulierem ad concupiscendum eam, jam mœchatus est eam in corde suo.</p>', '615', '650', '1', '2021-06-24T15:45:47.002Z', '2021-06-24T15:45:47.002Z' );
INSERT INTO object( uuid, id, title, body, views, likes, author-id, created-at, updated-at ) VALUES ( 'LomzCpUY', '12', '<p>Erit concilio. Qui autem.</p>', '<p>Esto consentiens adversario tuo cito dum es in via cum eo ne forte tradat te adversarius judici, et judex tradat te ministro et in carcerem mittaris.</p><p>Amen dico tibi, non exies inde, donec reddas novissimum quadrantem. Audistis quia dictum est antiquis Non mœchaberis. Ego autem dico vobis quia omnis qui viderit mulierem ad concupiscendum eam, jam mœchatus est eam in corde suo.</p>', '102', '527', '1', '2021-06-24T15:45:47.015Z', '2021-06-24T15:45:47.015Z' );
INSERT INTO object( uuid, id, title, body, views, likes, author-id, created-at, updated-at ) VALUES ( 's0XLVjAq', '13', '<p>Ejus neque per Jerosolymam.</p>', '<p>Exinde cœpit Jesus prædicare, et dicere Pœnitentiam agite appropinquavit enim regnum cælorum.  Ambulans autem Jesus juxta mare Galilææ, vidit duos fratres, Simonem, qui vocatur Petrus, et Andream fratrem ejus, mittentes rete in mare (erant enim piscatores),</p><p>Et ait illis Venite post me, et faciam vos fieri piscatores hominum. At illi continuo relictis retibus secuti sunt eum.</p>', '440', '491', '1', '2021-06-24T15:45:47.023Z', '2021-06-24T15:45:47.023Z' );
INSERT INTO object( uuid, id, title, body, views, likes, author-id, created-at, updated-at ) VALUES ( 'fUI5BCIh', '14', '<p>Nos perimus. Et dicit.</p>', '<p>Et ne velitis dicere intra vos Patrem habemus Abraham. Dico enim vobis quoniam potens est Deus de lapidibus istis suscitare filios Abrahæ. Jam enim securis ad radicem arborum posita est. Omnis ergo arbor, quæ non facit fructum bonum, excidetur, et in ignem mittetur.</p><p>Ego quidem baptizo vos in aqua in pœnitentiam qui autem post me venturus est, fortior me est, cujus non sum dignus calceamenta portare ipse vos baptizabit in Spiritu Sancto, et igni.</p>', '828', '898', '1', '2021-06-24T15:45:47.048Z', '2021-06-24T15:45:47.048Z' );
INSERT INTO object( uuid, id, title, body, views, likes, author-id, created-at, updated-at ) VALUES ( 'gvA4PZyk', '15', '<p>Mihi Domine, Domine, in.</p>', '<p>Ego autem dico vobis diligite inimicos vestros, benefacite his qui oderunt vos, et orate pro persequentibus et calumniantibus vos ut sitis filii Patris vestri, qui in cælis est qui solem suum oriri facit super bonos et malos et pluit super justos et injustos.</p><p>Si enim diligitis eos qui vos diligunt, quam mercedem habebitis? nonne et publicani hoc faciunt?</p>', '218', '916', '1', '2021-06-24T15:45:47.061Z', '2021-06-24T15:45:47.061Z' );
INSERT INTO object( uuid, id, title, body, views, likes, author-id, created-at, updated-at ) VALUES ( 'D3CvmGnV', '16', '<p>And in nomine tuo.</p>', '<p>Qui petit a te, da ei et volenti mutuari a te, ne avertaris.  Audistis quia dictum est Diliges proximum tuum, et odio habebis inimicum tuum.</p><p>Ego autem dico vobis diligite inimicos vestros, benefacite his qui oderunt vos, et orate pro persequentibus et calumniantibus vos ut sitis filii Patris vestri, qui in cælis est qui solem suum oriri facit super bonos et malos et pluit super justos et injustos.</p>', '607', '986', '1', '2021-06-24T15:45:47.078Z', '2021-06-24T15:45:47.078Z' );
INSERT INTO object( uuid, id, title, body, views, likes, author-id, created-at, updated-at ) VALUES ( 'uoZzHEhw', '17', '<p>Ei omnes male habentes.</p>', '<p>Ego autem dico vobis, non jurare omnino, neque per cælum, quia thronus Dei est neque per terram, quia scabellum est pedum ejus neque per Jerosolymam, quia civitas est magni regis neque per caput tuum juraveris, quia non potes unum capillum album facere, aut nigrum.</p><p>Sit autem sermo vester, est, est non, non quod autem his abundantius est, a malo est. Audistis quia dictum est Oculum pro oculo, et dentem pro dente.</p>', '973', '388', '1', '2021-06-24T15:45:47.086Z', '2021-06-24T15:45:47.086Z' );
INSERT INTO object( uuid, id, title, body, views, likes, author-id, created-at, updated-at ) VALUES ( 'tphSJWc1', '18', '<p>Vade prius reconciliari fratri.</p>', '<p>Ego autem dico vobis, non jurare omnino, neque per cælum, quia thronus Dei est neque per terram, quia scabellum est pedum ejus neque per Jerosolymam, quia civitas est magni regis neque per caput tuum juraveris, quia non potes unum capillum album facere, aut nigrum.</p><p>Sit autem sermo vester, est, est non, non quod autem his abundantius est, a malo est. Audistis quia dictum est Oculum pro oculo, et dentem pro dente.</p>', '670', '632', '1', '2021-06-24T15:45:47.097Z', '2021-06-24T15:45:47.097Z' );
INSERT INTO object( uuid, id, title, body, views, likes, author-id, created-at, updated-at ) VALUES ( 'Wv5aCdyr', '19', '<p>Lux vestra coram hominibus.</p>', '<p>Ait illi Jesus Rursum scriptum est Non tentabis Dominum Deum tuum.</p><p>Iterum assumpsit eum diabolus in montem excelsum valde et ostendit ei omnia regna mundi, et gloriam eorum, et dixit ei Hæc omnia tibi dabo, si cadens adoraveris me. Tunc dicit ei Jesus Vade Satana Scriptum est enim Dominum Deum tuum adorabis, et illi soli servies.</p>', '325', '220', '1', '2021-06-24T15:45:47.109Z', '2021-06-24T15:45:47.109Z' );
INSERT INTO object( uuid, id, title, body, views, likes, author-id, created-at, updated-at ) VALUES ( 'jgl08c5A', '20', '<p>Regno cælorum qui autem.</p>', '<p>Tunc reliquit eum diabolus et ecce angeli accesserunt, et ministrabant ei. Cum autem audisset Jesus quod Joannes traditus esset, secessit in Galilæam et, relicta civitate Nazareth, venit, et habitavit in Capharnaum maritima, in finibus Zabulon et Nephthalim ut adimpleretur quod dictum est per Isaiam prophetam Terra Zabulon, et terra Nephthalim, via maris trans Jordanem, alilæa gentium populus, qui sedebat in tenebris, vidit lucem magnam et sedentibus in regione umbræ mortis, lux orta est eis.</p><p>Exinde cœpit Jesus prædicare, et dicere Pœnitentiam agite appropinquavit enim regnum cælorum.  Ambulans autem Jesus juxta mare Galilææ, vidit duos fratres, Simonem, qui vocatur Petrus, et Andream fratrem ejus, mittentes rete in mare (erant enim piscatores),</p>', '817', '950', '1', '2021-06-24T15:45:47.147Z', '2021-06-24T15:45:47.147Z' );